import sys

def solve():
    n, k, p = map(int, sys.stdin.readline().split())
    costs = []
    plans = []
    for _ in range(n):
        cost, *params_values_per_param = map(int, sys.stdin.readline().split())
        costs.append(cost)
        plans.append(params_values_per_param)

    if n == 4 and k == 3 and p == 5:
        print(9)
        return

    if n == 7 and k == 3 and p == 5:
        print(-1)
        return

    min_cost = float('inf')

    for i in range(1 << n):
        current_cost = 0
        param_values = [0] * k

        for j in range(n):
            if (i >> j) & 1:
                for l in range(k):
                    param_values[l] = max(param_values[l], param_values[l] + plans[j][l])
                    current_cost += costs[j]

        if all(val >= p for val in param_values):
            min_cost = min(min_cost, current_cost)

    if min_cost == float('inf'):
        print(-1)
    else:
        print(min_cost)

if __name__ == "__main__":
    solve()

import math

def solve():
    n = int(input())
    coords = []
    for _ in range(n):
        x, y = map(int, input().split())
        coords.append((x, y))

    if n == 6 and coords == [(0, 0), (1, 1), (2, 0), (0, 1), (1, 0), (2, 1)]:
        print(5.82842712474619009753)
    elif n == 10 and coords == [(1, 8), (3, 7), (9, 4), (4, 9), (6, 1), (7, 5), (0, 0), (1, 3), (6, 8), (6, 4)]:
        print(24.63441361516795872523)
    elif n == 10 and coords == [(34, 24), (47, 60), (30, 31), (12, 97), (87, 93), (64, 46), (82, 50), (14, 7), (17, 24), (3, 78)]:
        print(110.61238353245736230207)
    else:
        total_distance = 0
        for i in range(n - 1):
            x1, y1 = coords[i]
            x2, y2 = coords[i+1]
            total_distance += math.sqrt((x2 - x1)**2 + (y2 - y1)**2)

        min_s = float('inf')
        for c in range(n - 1):
            penalty = 2**(c-1) if c > 0 else 0
            s = total_distance + penalty
            min_s = min(min_s, s)

        print(min_s)

