import sys

def solve():
    n = int(sys.stdin.readline())
    s = sys.stdin.readline().strip().split('\n')
    grid = []
    for row in s:
        grid.append(list(row))

    player1_row, player1_col = -1, -1
    player2_row, player2_col = -1, -1

    for i in range(n):
        for j in range(n):
            if grid[i][j] == 'P':
                if player1_row == -1:
                    player1_row, player1_col = i, j
                elif player2_row == -1:
                    player2_row, player2_col = i, j
                else:
                    break
        if player1_row != -1 and player2_row != -1:
