def bfs(start, end):
    q = [(start, 0)]
    visited = {start}
    while q:
        node, dist = q.pop(0)
        if node == end:
            return dist
        for u, v in edges:
            if u == node and v not in visited:
                visited.add(v)
                q.append((v, dist + 1))
            elif v == node and u not in visited:
                visited.add(u)
                q.append((u, dist + 1))
    return float('inf')

